import React from 'react'

class Game extends React.Component {
    render() {
        return (
            <div className="game">
                <h5>Game Id: game_id}</h5>
                <p>Game Status: status}</p>
                <p>Guessed: guessed}</p>
                <p>Correct: correct}</p>
            </div>
        )
    }
}

export default Game
